import React from 'react';
import {Row, Col} from 'reactstrap';
import '../static/css/projects.css';

export default class Projects extends React.Component {
    constructor(props) {
        super(props);
    }

    render () {
        return (
            <Row style={{padding: "50px 0"}}>
                <Col md="6">
                    <h4>Projects</h4>
                    <ul>
                        <li>Google</li>
                        <li>Microsoft</li>
                        <li>Apple</li>
                        <li>Amazon</li>
                    </ul>
                </Col>
                <Col md="6">
                    <h4>Expirience</h4>
                </Col>
            </Row>
        );
    }
}
